import DataContext from "../data/DataContext"
import { useContext } from "react";


const ReportComponents = () =>{

    return (
        <div>
            <DataContext.Consumer>
                {context => <p>{context.income}</p>}
            </DataContext.Consumer>
        </div>
    );
}

export default ReportComponents
